INSERT INTO `tbl_reviews` (`id`, `rater_name`, `rating`, `comment`, `submitted_at`) VALUES
(1, 'Matthew Jones', 5, 'Samson did a fantastic job on our website. The design is clean, responsive, and works smoothly on all devices. Communication was easy throughout the project and everything was delivered on time. Couldn’t be happier with the result.', '2025-07-18 21:09:44'),
(2, 'Sarah Arjuns', 4, 'Working with Samson was a great experience. He’s skilled, professional, and very reliable. The final product turned out exactly how we wanted. Only minor tweaks were needed, but overall, I highly recommend him.', '2025-07-18 21:11:07'),
(3, 'Salome Chichi', 5, 'Excellent work from start to finish. Samson handled both the front-end and back-end effortlessly and brought some really good ideas to the table. The project was delivered on time and exceeded our expectations.', '2025-07-18 21:12:40'),
(4, 'Daniel Reed', 5, 'Really impressed with the work done here. Everything was built from scratch exactly how I pictured it. Fast, professional, and great communication throughout the process.', '2025-08-05 13:22:11'),
(5, 'Aisha Karim', 4, 'Overall a very smooth experience. The app works well and any issues were quickly fixed. Would definitely work together again on future projects.', '2025-08-12 09:17:33'),
(6, 'Leon Matthews', 5, 'Top-notch developer! The attention to detail and dedication to getting everything right was clear from day one. Highly recommended for anyone looking for a reliable full stack developer.', '2025-08-20 17:41:20'),
(7, 'Clara Jennings', 3, 'The end result was good and functional, but communication could have been a bit faster at times. Still, the overall quality of work was solid and worth the investment.', '2025-08-25 11:55:44'),
(8, 'Oliver Grant', 5, 'Super happy with the final product. Everything was well structured, easy to use, and exactly what our business needed. Would definitely hire again!', '2025-09-02 08:13:02'),
(9, 'Isabella Moore', 4, 'Good experience overall. The website performs well and looks professional. A few small revisions were needed, but they were handled quickly and without any fuss.', '2025-09-10 15:28:59');
INSERT INTO `uploaded_projects` (`id`, `title`, `description`, `file_url`, `rating`, `slug`, `sampleurl`, `uploaded_at`) VALUES
(1, 'Eddie & Ese', 'Project: eaffairs25.esesphere.com\r\nRole: Lead Full Stack Developer & System Administrator\r\nDuration: [Insert duration here, e.g., Jan 2024 – May 2025]\r\n\r\nAs the lead Full Stack Developer for this digital platform, I developed a secure, responsive, and highly functional online system tailored for administrative and user-based workflows. The site enables electronic affairs management, user registration, document handling, and real-time system interactions.\r\n\r\n🧰 Technologies Used\r\nFrontend: HTML5, CSS3, JavaScript, Bootstrap, Ajax\r\nBackend: PHP (CodeIgniter Framework)\r\nDatabase: MySQL\r\nOther: RESTful API Integration, Server Configuration, Linux System Administration\r\n\r\n💼 Key Responsibilities & Achievements\r\n✅ Designed & Developed Complete Frontend and UI:\r\nBuilt responsive layouts using Bootstrap and custom CSS, delivering a clean and intuitive interface across all devices (desktop, tablet, mobile).\r\nUsed JavaScript and Ajax to create dynamic forms and asynchronous interactions, reducing page reloads and improving user experience.\r\n\r\n✅ Engineered Secure and Scalable Backend Functionality:\r\nDeveloped backend services with PHP (CodeIgniter MVC framework), implementing clean code structure and logic separation for easy maintenance and scalability.\r\nDesigned a role-based access control system, allowing user privilege separation (e.g., admin, sub-admin, general users).\r\nBuilt secure login, session management, and data validation systems to protect sensitive information.\r\n\r\n✅ Database Design & Optimization:\r\nDesigned a normalized MySQL database schema supporting user data, documents, request submissions, approval workflows, logs, and system settings.\r\nImplemented data indexing and optimized SQL queries to ensure fast and reliable performance, even under load.\r\n\r\n✅ RESTful API Development & Integration:\r\nDeveloped and consumed RESTful APIs to handle operations such as document submission, data retrieval, and system integration with external modules.\r\nCreated modular API endpoints that can easily be expanded for future features.\r\n\r\n✅ System Administration & Deployment:\r\nConfigured and deployed the application on a Linux-based server environment, ensuring uptime, security, and performance.\r\nManaged server hardening, database backups, SSL certificates, and domain setup.\r\nPerformed load testing and applied caching strategies to improve system responsiveness.\r\n\r\n✅ Feature Highlights:\r\nUser Management System: Admin dashboard with CRUD operations, user registration, approval, and activation features.\r\nDocument Workflow: Upload, track, and process digital documents through various stages with real-time updates.\r\nNotification System: Email and in-system alerts for user actions, approvals, and system status updates.\r\nAudit Logs: Maintained detailed logs for actions across the system for traceability and compliance.\r\nMobile Responsiveness: Ensured full usability and navigation on smartphones and tablets.\r\n\r\n🚀 Challenges Overcome\r\nEnsured data integrity while multiple users accessed the platform concurrently.\r\nResolved cross-browser compatibility issues to provide a uniform experience across all major browsers.\r\nImplemented security best practices, including input sanitization, SQL injection prevention, and HTTPS encryption.\r\n\r\n📈 Outcome & Impact\r\nDelivered a fully functional, stable system ready for real-world deployment and user onboarding.\r\nSignificantly reduced manual administrative workload by digitizing core operations and approval flows.\r\nBuilt a scalable foundation that can be expanded with additional modules (e.g., analytics, reporting, or third-party integrations).', 'eddieandese.png', 5, 'Eddie-and-Ese', 'https://eaffairs25.esesphere.com/', '2025-07-19 09:13:02'),
(2, 'Ese Sphere Enterprise', 'Project: esesphere.com\r\nRole: Full Stack Developer & Technical Architect\r\nDuration: [Insert project duration here]\r\n\r\nAs the full stack developer behind ESE Sphere, I designed and developed a modern, professional website for a tech-focused company providing digital solutions and administrative platforms. The goal was to create a visually appealing, responsive, and technically robust corporate site that communicates trust, capability, and innovation — while ensuring top-tier performance and maintainability.\r\n\r\n🧰 Technologies Used\r\nFrontend: HTML5, CSS3, JavaScript, Bootstrap\r\nBackend: PHP (CodeIgniter Framework)\r\nDatabase: MySQL\r\nOther: RESTful API Integration, Ajax, Linux Server Administration\r\n\r\n💼 Key Responsibilities & Contributions\r\n✅ Custom Frontend Design & UX Development:\r\nBuilt a clean, corporate design using HTML, CSS, and Bootstrap, ensuring consistency with the company’s branding and digital identity.\r\nImplemented responsive layouts for optimal user experience on desktop, tablet, and mobile devices.\r\nUsed JavaScript and Ajax to create smooth UI transitions, real-time content updates, and responsive navigation.\r\n\r\n✅ Backend Development & Content Management Logic:\r\nDeveloped the backend using PHP with CodeIgniter, managing dynamic content sections such as Services, About, Contact, and Blog.\r\nBuilt custom CMS-like functionality for administrators to manage website content and page updates.\r\nEnsured clear separation of concerns and maintainability by following MVC principles.\r\n\r\n✅ Database Architecture & Integration:\r\nDesigned a lightweight, efficient MySQL database to handle inquiries, newsletter signups, and service requests.\r\nDeveloped backend forms and admin views to track and respond to leads.\r\n\r\n✅ RESTful API Integration:\r\nConnected external services (e.g., contact form to email system or CRM) via RESTful APIs, enabling streamlined data flow and notifications.\r\n\r\n✅ Server-Side Deployment & Optimization:\r\nDeployed the site on a secure Linux-based hosting environment, including DNS setup, firewall configuration, and SSL integration.\r\nApplied performance optimizations, including file minification, caching headers, and server tuning.\r\n\r\n✅ SEO & Accessibility Improvements:\r\nImplemented metadata, alt tags, semantic HTML, and structured data to enhance search engine visibility.\r\nDesigned content layout to meet WCAG accessibility guidelines for better inclusivity.\r\n\r\n✨ Key Features Implemented\r\nInteractive Contact Form: With validation, Ajax submission, and real-time feedback.\r\nCustom Admin Dashboard: For content updates, lead management, and analytics integration.\r\nMobile-First Experience: Intuitive touch-based navigation and optimized load speed.\r\nScalable Architecture: Easily extendable for future modules (e.g., user portals, service integrations).\r\n\r\n🚀 Impact & Results\r\nDelivered a fully functional, client-ready corporate site that aligned with business goals and brand vision.\r\nIncreased visitor engagement through fast-loading pages and responsive design.\r\nLaid the foundation for future platform integrations (e.g., client portals, billing systems).\r\n\r\n🔧 Challenges Addressed\r\nBalanced a clean design with flexible backend management.\r\nOptimized page load time by reducing server-side bottlenecks and minimizing HTTP requests.\r\nEnsured cross-browser consistency and device compatibility through rigorous testing.', 'esesphere.png', 5, 'Ese-Sphere-Enterprise', 'https://esesphere.com/', '2025-07-19 09:17:05'),
(3, 'Gogos - Engineering, Procurement, Construction and Services', 'Project: gogosltd.com\r\nRole: Full Stack Developer & System Administrator\r\nDuration: [Insert project timeline here]\r\nIndustry: International Logistics, Procurement, and Trade Consulting\r\n\r\nAs the Full Stack Developer behind GOGOS LTD’s official website, I was responsible for designing and implementing a multilingual corporate website that supports the company’s global presence in logistics, procurement, and business consulting. This platform delivers a seamless experience for international users, effectively communicating the company’s services and credibility.\r\n\r\n🧰 Technologies Used\r\nFrontend: HTML5, CSS3, JavaScript, Bootstrap\r\nBackend: PHP (CodeIgniter Framework)\r\nDatabase: MySQL\r\nOther: RESTful API, Ajax, cPanel Hosting, Linux Server Management\r\n\r\n💼 Key Responsibilities & Achievements\r\n✅ Modern Corporate Website Development:\r\nBuilt a fully responsive website using HTML5, CSS3, and Bootstrap, ensuring optimal display on desktops, tablets, and mobile devices.\r\nDesigned a clean, professional UI aligned with the company’s brand identity and tailored to appeal to international B2B clients.\r\n\r\n✅ Dynamic Content & Backend System (PHP + CodeIgniter):\r\nDeveloped a modular backend system using CodeIgniter to manage dynamic pages, service descriptions, partner information, and inquiries.\r\nIntegrated a language switcher and localization system to support both English and additional languages (e.g., French, Chinese in future versions).\r\n\r\n✅ Custom Contact & Inquiry System:\r\nCreated a secure, Ajax-powered contact form with server-side validation and email notification system.\r\nIntegrated backend storage and email routing to relevant company departments based on inquiry type.\r\n\r\n✅ SEO, Performance, and Usability Enhancements:\r\nImplemented SEO best practices including meta tags, structured data, optimized images, and fast-loading assets.\r\nUsed AJAX for lightweight form submissions and navigation enhancements without full page reloads.\r\nEnsured WCAG accessibility compliance and UX optimization for diverse international users.\r\n\r\n✅ System Administration & Hosting:\r\nDeployed the website via cPanel, managing domains, subdomains, SSL certificates, and performance tuning.\r\nSet up MySQL databases, performed data migrations, and configured automated backups and security settings.\r\n\r\n✅ Security and Optimization:\r\nApplied input validation, CAPTCHA, and email sanitization to prevent spam and malicious requests.\r\nMinified CSS/JS and enabled GZIP compression to enhance performance scores.\r\n\r\n🌐 Feature Highlights\r\nMultilingual Ready: English version fully developed with future capability for language expansion\r\nResponsive Design: Tailored for business professionals accessing via mobile or desktop\r\nCustom Admin Panel: Manage text, services, and company information easily without coding\r\nClient-Focused Navigation: Clean menus and CTAs optimized for business conversions\r\n\r\n🚀 Challenges Overcome\r\nBuilt a future-proof site structure to allow easy expansion into other languages and service verticals\r\nBalanced corporate professionalism with modern UI elements to engage a global audience\r\nEnsured secure and reliable performance on a shared hosting environment with limited resources\r\n\r\n📈 Outcome & Impact\r\nDelivered a polished, professional website that has become the public face of GOGOS LTD to partners, clients, and stakeholders worldwide\r\nEnhanced company credibility through a trust-building design and clear communication of services\r\nProvided a scalable platform ready for CRM integration, analytics, and multilingual growth', 'geocareservices.png', 5, 'Gogos---Engineering,-Procurement,-Construction-and-Services', 'https://www.gogosltd.com/', '2025-07-19 09:19:32'),
(4, 'Geocare Services Limited', 'Project: GeoCare Services UK\r\nRole: Full Stack Developer & Technical Lead\r\nDuration: [Insert duration here, e.g., March 2024 – July 2025]\r\n\r\nAs the full stack developer for GeoCare Services UK, I was responsible for building a fully responsive and secure website to represent a UK-based health and social care company. The goal of this project was to establish a professional digital presence, streamline recruitment workflows, and make information easily accessible to clients, job seekers, and stakeholders.\r\n\r\n🧰 Technologies Used\r\nFrontend: HTML5, CSS3, JavaScript, Bootstrap\r\nBackend: PHP (CodeIgniter Framework)\r\nDatabase: MySQL\r\nOther: Ajax, RESTful APIs, SEO Optimization, Linux Server Management\r\n\r\n💼 Key Responsibilities & Achievements\r\n✅ Full Website Design & Development:\r\nCreated the full site layout using HTML, CSS, and Bootstrap, ensuring a clean, modern, and responsive design.\r\nBuilt interactive sections such as job listings, service details, and contact forms using JavaScript and Ajax for seamless interactivity.\r\nOptimized UI/UX for accessibility and ease of navigation across all devices (mobile, tablet, and desktop).\r\n\r\n✅ Backend & CMS Development:\r\nUsed PHP and CodeIgniter to develop a custom, lightweight CMS tailored for managing job vacancies, staff applications, and content updates.\r\nBuilt secure forms and data processing logic to handle job applications, contact inquiries, and dynamic content updates without needing third-party tools.\r\n\r\n✅ Database Design & Integration:\r\nCreated a structured MySQL database to store user submissions, job applications, and service-related content.\r\nEnsured data security and GDPR compliance for sensitive user information collected via forms.\r\n\r\n✅ Feature Highlights:\r\nCare Services Overview: Clean and well-structured presentation of health and social care services.\r\nOnline Application Forms: Job seekers can submit detailed applications, with real-time field validation.\r\nContact & Inquiry Forms: Built with spam protection and automated admin notifications.\r\nCareer Section: Fully manageable via the backend, allowing quick posting and removal of job vacancies.\r\nNewsletter/Subscription Ready: Designed and integrated backend logic to collect user emails for future mailing or updates.\r\nLive Google Maps Integration: Embedded interactive maps to help users locate the office easily.\r\n\r\n✅ SEO & Performance Optimization:\r\nEnsured all pages followed on-page SEO best practices, including meta tags, open graph data, and fast load times.\r\nOptimized images, minified scripts, and implemented caching to enhance performance.\r\n\r\n✅ Deployment & Hosting:\r\nDeployed the site on a Linux VPS with Apache configuration.\r\nSet up SSL certificate, domain DNS management, and automated backup scripts to ensure reliability and data safety.\r\nPerformed regular system checks and updates to maintain uptime and security.\r\n\r\n🚀 Challenges Solved\r\nCreated a tailored CMS instead of using bulky third-party platforms to provide lightweight speed and flexibility.\r\nSolved layout and form validation challenges to meet both user accessibility and business branding requirements.\r\nManaged email delivery issues via server-side configurations to ensure all form submissions reached the admin inbox reliably.\r\n\r\n📈 Outcome & Impact\r\nDelivered a professional-grade website that improved client trust, strengthened the company’s digital presence, and enabled fast, online recruitment.\r\nSimplified internal workflows for HR and admin staff by digitizing job application processes.\r\nSet up a foundation for future scalability, such as adding staff portals or service booking features.', 'geosoftcare.png', 5, 'Geocare-Services-Limited', 'https://www.geocareservices.co.uk/', '2025-07-19 09:21:56'),
(5, 'Phare X', 'Project: phare-x.com\r\nRole: Full Stack Developer & Systems Engineer\r\nDuration: [Insert Duration Here – e.g., Mar 2024 – Jul 2025]\r\n\r\nI served as the Full Stack Web Developer responsible for designing, developing, and deploying the complete Phare-X platform a specialized website built to showcase Phare-X\'s services in strategy, governance, digital transformation, and leadership consulting. The site emphasizes modern design, responsiveness, clarity of messaging, and fast performance to reflect the brand’s professionalism and innovation.\r\n\r\n🧰 Technologies Used\r\nFrontend: HTML5, CSS3, JavaScript, Bootstrap\r\nBackend: PHP\r\nDatabase: MySQL\r\nOthers: Ajax, RESTful API, Linux System Administration, SEO Optimization, Cross-Browser Support\r\n\r\n💼 Key Responsibilities & Achievements\r\n✅ Website Architecture & Front-End Development\r\nBuilt a sleek, modern UI using HTML, CSS, and Bootstrap, ensuring the layout was responsive and accessible on all devices.\r\nEmployed JavaScript for interactivity and dynamic content loading.\r\nIntegrated Ajax calls for smooth, asynchronous page interactions, reducing full-page reloads and improving site speed.\r\n\r\n✅ Backend & Business Logic Development\r\nDeveloped backend logic using PHP with the CodeIgniter MVC framework, keeping the codebase modular and maintainable.\r\nSet up a flexible structure for future expansion, such as adding blog functionality or service-specific landing pages.\r\nImplemented structured routing and clean URL patterns for better SEO and user experience.\r\n\r\n✅ Database Design & Content Management\r\nDesigned a MySQL database schema to manage content sections, contact forms, and dynamic elements.\r\nBuilt admin-side functionality for content updates without requiring technical knowledge, streamlining future maintenance for non-developers.\r\n\r\n✅ RESTful API Integration\r\nImplemented RESTful API endpoints for handling contact form submissions, inquiries, and future third-party CRM integration.\r\n\r\n✅ System Deployment & Administration\r\nHandled domain setup, Linux server configuration, and deployment.\r\nInstalled and configured SSL certificates, enabled HTTPS, and optimized server performance for fast page load speeds.\r\nSet up error logging and uptime monitoring for production readiness.\r\n\r\n✅ Additional Features & Enhancements\r\nContact Form Integration: Dynamic and validated contact form with backend routing and optional email notifications.\r\nSEO Optimization: Added semantic tags, meta descriptions, alt attributes, and structured URLs to boost search engine visibility.\r\nPerformance Tuning: Applied minification and asset compression to reduce page load times and improve Lighthouse scores.\r\nSecurity: Hardened the application against common web threats, including input sanitization, CSRF protection, and server hardening.\r\n\r\n🚀 Challenges Overcome\r\nEnsured a clean, fast-loading experience while still allowing for elegant branding visuals and smooth animations.\r\nBalanced visual design with content clarity, working with limited written material to highlight Phare-X’s core message.\r\nBuilt a maintainable backend structure that allows future scaling and CMS-like editing with minimal code intervention.\r\n\r\n📈 Outcome & Impact\r\nDelivered a polished, professional online presence that aligns with Phare-X’s high-level consulting brand.\r\nSignificantly enhanced user engagement and reduced bounce rates by offering a fast, mobile-optimized interface.\r\nPositioned the platform for future lead generation and digital marketing efforts by building with SEO and scalability in mind.', 'gogoslimited.png', 5, 'Phare-X', 'https://phare-x.com/', '2025-07-19 09:24:49'),
(6, 'Tasha Godwin e-Commerce', 'Project: tashagodwin.com\r\nRole: Full Stack Web Developer\r\nDuration: January 2025]\r\n\r\nFor this project, I developed a fully functional and professionally branded WordPress-based e-commerce website for Tasha Godwin focused on selling digital and physical products. The project required full-cycle implementation, from server setup to deployment, and ongoing maintenance, ensuring a fast, secure, and user-friendly shopping experience.\r\n\r\n🧰 Technologies Used\r\nCMS: WordPress\r\nE-commerce Framework: WooCommerce\r\nFrontend: HTML5, CSS3, JavaScript, Bootstrap\r\nBackend: PHP, MySQL\r\nOther Tools: Ajax, RESTful APIs, WordPress Customizer, Elementor, Yoast SEO, SMTP, Stripe/PayPal Integration\r\n\r\n💼 Key Responsibilities & Achievements\r\n✅ E-Commerce Site Setup & Customization\r\nSet up and configured WooCommerce with multiple product types (digital downloads, physical goods).\r\nCustomized product pages, shop layout, and checkout flow to enhance user experience and align with the brand.\r\nIntegrated Stripe and PayPal for secure payment processing with custom success pages and email confirmations.\r\nImplemented discount coupons, shipping rules, tax settings, and cart behavior according to client business logic.\r\n\r\n✅ Theme Development & UI Design\r\nBuilt a fully responsive custom WordPress child theme using Bootstrap, HTML/CSS, and JavaScript for interactive front-end behavior.\r\nUsed Elementor and advanced custom fields (ACF) to allow for flexible content editing by non-technical users.\r\nEnsured consistent brand styling across pages, including homepage, shop, product detail pages, blog, and about sections.\r\n\r\n✅ Backend & Plugin Customization\r\nModified and extended WordPress and WooCommerce functions using custom PHP snippets and hooks.\r\nDeveloped custom post types and taxonomies to manage non-product content such as testimonials, blog posts, and FAQs.\r\nIntegrated Ajax for features like “Add to Cart” without page reload and live product search.\r\n\r\n✅ Performance Optimization & SEO\r\nInstalled and configured caching plugins, lazy loading, and image optimization tools to enhance site speed and Core Web Vitals.\r\nImplemented on-page SEO strategies using Yoast SEO, structured data, and custom metadata fields.\r\nOptimized database queries and cleaned unused plugins/themes for minimal overhead.\r\n\r\n✅ Security & System Administration\r\nHardened WordPress security with firewall configuration, login protection, and regular plugin/theme audits.\r\nConfigured daily backups, SSL encryption (HTTPS), and secure file permissions.\r\nHandled domain setup, DNS configuration, and deployment to a Linux-based hosting environment.\r\n\r\n✅ Client Empowerment & Handoff\r\nCreated documentation and training materials to help the client manage inventory, process orders, and update content.\r\nSet up email SMTP integration to ensure reliable delivery of order confirmations and contact forms.\r\n\r\n✨ Key Features at a Glance\r\nFully functional WooCommerce store with checkout, cart, and account management\r\nMobile-optimized shopping experience\r\nIntegrated secure payments (Stripe, PayPal)\r\nProduct categories, filters, and search\r\nAdmin panel for managing orders, stock, coupons, and content\r\nNewsletter signup and marketing-ready infrastructure\r\nSEO and performance-optimized\r\n\r\n🚧 Challenges Solved\r\nOvercame plugin compatibility issues to enable seamless cart behaviour across devices.\r\nEnsured digital product delivery security and download protection using WooCommerce extensions.\r\nBalanced flexibility and simplicity to give the client full control without overwhelming complexity.\r\n\r\n📈 Outcome & Impact\r\nDelivered a modern, conversion-optimized e-commerce platform that supports the client’s brand and business goals.\r\nReduced third-party dependency by customizing built-in WordPress/WooCommerce features.\r\nEmpowered the client with a fully manageable, scalable online store with high uptime, speed, and reliability.', 'natasha.png', 5, 'Tasha-Godwin---Wordpress-e-Commerce', 'https://tashagodwin.com/', '2025-07-19 09:31:58'),
(7, 'Staff Scroll Limited', 'Project: StaffScroll.co.uk\r\nRole: Full Stack Developer & Technical Lead\r\nDuration: June 2025 – July 2025\r\n\r\nStaffScroll is a powerful staff and HR management system built to streamline employee records, shift scheduling, leave tracking, and admin reporting. I led the full stack development, from designing the UI/UX and database structure to writing core logic, integrating APIs, and deploying the application on a secure server environment.\r\n\r\n🧰 Technologies Used\r\nFrontend: HTML5, CSS3, JavaScript, Bootstrap, Ajax\r\nBackend: PHP\r\nDatabase: MySQL\r\nAdditional: RESTful APIs, Linux Server Administration, Email Notification System, Responsive Design\r\n\r\n💼 Key Responsibilities & Contributions\r\n✅ Custom UI/UX Development:\r\nDeveloped a modern, clean, and responsive front-end interface using HTML, CSS, Bootstrap, and JavaScript, ensuring smooth navigation and accessibility across devices.\r\nImplemented dynamic content loading and interactive components with Ajax, improving load speed and user experience.\r\n\r\n✅ Back-End Architecture & Business Logic:\r\nWrote modular, scalable backend functionality using PHP and CodeIgniter, handling logic for employee profiles, shift scheduling, attendance, and leave management.\r\nBuilt structured and reusable controller-model-view logic to speed up future development and maintenance.\r\n\r\n✅ Advanced Staff & Shift Management Features:\r\nDeveloped features like employee onboarding, role/position assignment, shift creation, and real-time shift allocation.\r\nIncluded leave request and approval workflows, built-in holiday management, and overtime tracking.\r\nCreated customizable admin dashboards with quick stats, filterable tables, and reporting tools.\r\n\r\n✅ RESTful API Integration & Internal Services:\r\nDesigned and consumed RESTful APIs to enable seamless communication between different modules, making the platform easily extensible for third-party services like payroll or messaging.\r\n\r\n✅ Database Design & Optimization:\r\nBuilt a relational MySQL database with normalized tables for employees, schedules, attendance logs, leave records, and admin actions.\r\nEnsured referential integrity and optimized SQL queries for high-performance under concurrent user activity.\r\n\r\n✅ Authentication, Roles, & Security:\r\nDeveloped a secure multi-level authentication system (Admin, HR, Staff) with session handling, token generation, and permissions control.\r\nApplied input sanitization, password hashing, and secure login methods to prevent vulnerabilities.\r\n\r\n✅ Email Notification & System Alerts:\r\nIntegrated automated email alerts for shift assignments, leave approvals, and system notifications using PHP’s mailer libraries.\r\nDeveloped internal alert banners and modals for real-time in-app messaging.\r\n\r\n✅ System Deployment & Administration:\r\nDeployed the application on a secure Linux-based hosting environment, configured SSL (HTTPS), and managed domain setup.\r\nHandled server-side configurations, including cron jobs for scheduled tasks (e.g., daily attendance logs or reminders).\r\nMonitored logs, updated server packages, and performed system-level security audits.\r\n\r\n⚙️ Key Features Developed\r\nStaff registration and profile management\r\nShift and rota scheduling system\r\nLeave application and approval flow\r\nAdmin-controlled system settings and user roles\r\nReal-time data dashboards with filtering/sorting\r\nMobile-friendly responsive UI\r\nNotifications via email and in-app banners\r\nSecure login and password reset functionality\r\n\r\n🚀 Challenges Solved\r\nDesigned flexible shift templates to accommodate diverse working hours and overnight shifts\r\nPrevented scheduling conflicts by implementing validation rules at both the UI and database level\r\nManaged high volumes of data with pagination and live search for admin dashboards\r\nEnsured GDPR-compliant handling of employee data\r\n\r\n📈 Project Impact\r\nDelivered a centralized, secure HR and staff management platform that reduces manual paperwork and administrative overhead\r\nSimplified scheduling and improved visibility for both staff and administrators', 'pharex.png', 5, 'Staff-Scroll-Limited', 'https://staffscroll.co.uk/', '2025-07-19 09:35:15'),
(8, 'GeoSoftCare Healthcare Management', 'Project Type: SaaS-Based Web & Mobile Application\r\nRole: Full Stack Developer & System Administrator\r\nTech Stack:\r\nFrontend: HTML, CSS, JavaScript, Bootstrap, Tailwind CSS\r\nBackend: PHP (CodeIgniter Framework), MySQL, RESTful API, Ajax\r\nMobile: Flutter\r\nSystem Admin: Server & Database Management\r\n\r\n🔧 Project Overview:\r\nGeosoftcare is a comprehensive healthcare management system designed to streamline operations for domiciliary care providers, caregivers, and healthcare managers. As the full stack developer, I designed, built, and maintained both the web-based platform and mobile app, ensuring a secure, scalable, and user-friendly experience for all users, including carers, service users, and administrators.\r\n\r\n🧩 Core Modules Developed:\r\n👩‍⚕️ Carer & Service User Management\r\nDeveloped secure CRUD systems for registering, managing, and archiving carers and service users.\r\nIntegrated health records, contact logs, incident reports, and digital signatures.\r\n\r\n🕓 Rota & Shift Scheduling\r\nDesigned a dynamic rota management tool with drag-and-drop functionality.\r\nImplemented availability calendars, shift swaps, and real-time updates with Ajax for seamless interaction.\r\n\r\n💊 Medication & eMAR Charting\r\nBuilt an electronic medication administration record (eMAR) system for real-time medication tracking.\r\nIntegrated Flutter mobile app to allow carers to log medications during home visits.\r\n\r\n📆 Task & Visit Management\r\nDeveloped task assignment features with time logging and priority filters.\r\nIntegrated GPS tracking and visit verification using mobile device geolocation.\r\n\r\n📱 Cross-Platform Mobile App (Flutter)\r\nCreated a Flutter-based mobile app for carers to manage daily tasks, medication, and attendance on the go.\r\nSynced real-time with the main web platform via RESTful APIs.\r\n\r\n💰 Finance Portal\r\nBuilt invoicing, payroll, and shift-cost calculation modules with secure user-level access.\r\nIntegrated automated invoice generation and PDF export.\r\n\r\n📡 RESTful API & Ajax Interactions\r\nDeveloped scalable RESTful APIs for smooth frontend-backend communication.\r\nUsed Ajax for asynchronous data fetching and real-time UI updates.\r\n\r\n🔐 System Admin & Security\r\nConfigured secure server environments, managed user roles and permissions.\r\nImplemented access control, audit trails, and encryption for sensitive data.\r\n\r\n📈 Key Achievements:\r\nSuccessfully deployed a fully functional, scalable care management SaaS platform.\r\nReduced administrative workload by automating scheduling, reporting, and compliance tracking.\r\nEnabled carers to document care in real time through mobile integration, enhancing service transparency and accountability.\r\n\r\n👨‍💻 Responsibilities:\r\nFull lifecycle development: requirements gathering, development, deployment, and support.\r\nDesigned database schema and optimized MySQL queries for performance.\r\nImplemented responsive UI using Bootstrap and Tailwind CSS.\r\nManaged server deployments and routine database backups as system administrator.\r\n\r\n📍 What This Project Demonstrates:\r\nProficiency in full stack development using PHP (CodeIgniter), MySQL, JavaScript, and modern UI frameworks.\r\nExperience integrating mobile apps with REST APIs.\r\nUnderstanding of healthcare workflow and digital care documentation requirements.\r\nAbility to deliver secure, high-performance software solutions in a regulated environment.', 'staffscroll.png', 5, 'GeoSoftCare-Healthcare-Management-Platform', 'https://geosoftcare.co.uk/', '2025-07-19 09:41:37'),
(9, 'Eagle I Group', 'Website: eagleisecurity.co.uk\r\nProject Type: Business Website & Service Management Platform\r\nRole: Full Stack Developer & System Administrator\r\nTech Stack:\r\n\r\nFrontend: HTML, CSS, JavaScript, Bootstrap, Tailwind CSS\r\nBackend: PHP (CodeIgniter Framework), MySQL, RESTful API, Ajax\r\nSystem Admin: Server & Database Management\r\n\r\n🔧 Project Overview\r\nEagle I Group is a service-based company specializing in security and cleaning solutions, offering services such as CCTV installation, residential/commercial security, office cleaning, and janitorial services. I was responsible for developing a professional business website that not only showcases their services but also provides a service request and management platform to streamline client interactions and back-office operations.\r\n\r\nThe goal was to build a secure, mobile-responsive, SEO-optimized platform that highlights Eagle I Group’s core services while providing tools for inquiry handling, staff allocation, and service scheduling.\r\n\r\n🧩 Core Modules Developed\r\n🔒 Security Services Management\r\nBuilt a structured module to showcase residential and commercial security packages.\r\nIntegrated enquiry forms with backend database storage and email notifications.\r\nDeveloped service request tracking for security patrols and CCTV installation.\r\n\r\n🧹 Cleaning Services Management\r\nCreated a detailed service listing for office cleaning, janitorial services, and residential cleaning.\r\nImplemented booking forms with dynamic pricing based on service type and frequency.\r\n\r\n📸 CCTV & Surveillance Integration\r\nDesigned pages for promoting CCTV installation & surveillance services.\r\nAdded a request system for site survey bookings.\r\n\r\n📱 Responsive UI & User Experience\r\nBuilt a mobile-first interface with Bootstrap and Tailwind CSS.\r\nEnsured seamless browsing across devices for clients to easily explore services.\r\n\r\n📩 Client Enquiry & Contact System\r\nDeveloped a custom contact form system with MySQL database storage.\r\nIntegrated Ajax-powered real-time form validation and email notifications.\r\n\r\n🖥️ Admin Dashboard (Internal Use)\r\nBuilt a lightweight CMS-like backend for managing service requests.\r\nEnabled staff to update content, review enquiries, and assign staff to jobs.\r\n\r\n🔐 System Admin & Security\r\nConfigured secure server hosting and database management.\r\nImplemented role-based access controls for admins and staff.\r\nEnforced SSL encryption for all client interactions.\r\n\r\n📈 Key Achievements\r\nDelivered a fully functional business website with integrated enquiry and service management features.\r\nImproved online visibility through SEO optimization (keywords like Eagle I Security, Eagle I Cleaner, CCTV installation, professional cleaners).\r\nEnabled Eagle I Group to handle more client requests digitally, reducing manual paperwork and phone-based enquiries.\r\nEnhanced brand credibility with a professional, modern web presence.\r\n\r\n👨‍💻 Responsibilities\r\nDesigned and implemented both the frontend and backend of the platform.\r\nDeveloped MySQL database schema for service management and client requests.\r\nIntegrated Ajax and RESTful APIs for smooth real-time interactions.\r\nManaged hosting, domain, SSL, and server-side security configurations.\r\n\r\n📍 What This Project Demonstrates\r\nExpertise in building business-focused service websites with CMS-like features.\r\nProficiency in PHP (CodeIgniter), MySQL, JavaScript, Bootstrap, Tailwind CSS.\r\nAbility to integrate service booking, enquiry handling, and internal dashboards.\r\nExperience in creating secure, SEO-optimized, and scalable platforms for small-to-medium service businesses.', 'eagleIsecurity.png', 4, 'Eagle-I-Group-(Eagle-I-Security-&-Cleaner)', 'https://eagleisecurity.co.uk', '2025-09-02 21:47:31');
